import React from 'react';
import DashboardLayout from '../components/DashboardLayout';

const UserPage = () => {
  return (
    <DashboardLayout>
      <h2>User Dashboard</h2>
      <p>Hai pengguna! Ini adalah halaman utama Anda.</p>
    </DashboardLayout>
  );
};

export default UserPage;
